import React from "react";
import { AppBar, Autocomplete, Box, Tab, Tabs, TextField, Toolbar } from "@mui/material";
import MovieIcon from "@mui/icons-material/MovieCreation";

const Header = () => {
  const dummyArray = ["eemro", "3idiots"];
  return (
    <AppBar>
      <Toolbar>
        <Box width={"20%"}>
          <MovieIcon />
        </Box>
        <Box width={"50%"} margin={"auto"}>
          <Autocomplete
            freeSolo
            options={dummyArray.map((option) => option)}
            renderInput={(params) => (
              <TextField variant="standard" {...params} label="Search Across Movies" />
            )}
          />
        </Box>
        <Box display={'flex'}>
        <Tabs indicatorColor="secondary" value={1}>
            <Tab label="Admin"/>
            <Tab label="Auth"/>
            <Tab label="Movies"/>
        </Tabs>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
